func minKBitFlips(A []int, K int) int {
	l := len(A)
	f := 0
	n := 0
	h := make([]int, l)

	for i := range A {
		f ^= h[i]
		if A[i] ^ f == 0 {
			n++
			if i + K > l {
				return -1
			}
			f ^= 1
			if i + K < l {
				h[i + K] ^= 1
			}
		}

	}

	return n
}

